const root = ReactDOM.createRoot(el);

function App(){

    let msj="Mensaje Random";
    let num = Math.random();

    if( num > 0.5){
        msj= "se modificó el msg";
    }

    return <h1>el resultado es {msj} </h1>//JSX
    return <h2>El numero que salio es el {msj} </h2>

}

root.render(<App/>);
